  return (
    <>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "flex-start",
          paddingLeft: "10px",
        }}
      >
        <BackButton />
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          paddingLeft: "10px",
        }}
      >
        <PlotDetails />{" "}
      </div>
    </>
  );
};

export default ShowsDetailsPage;
